void oz_labs_floor1_menu() {
    int choice;
    while(true) {
        system("cls");
        cout << "\n--- OZ Laboratories: 1st Floor ---\n";
        cout << "1. General Map & Fire Extinguishers\n";
        cout << "2. Nearest Exit (Route 1)\n";
        cout << "3. Nearest Exit (Route 2)\n";
        cout << "0. Back\n";
        cout << "Choice: ";
        if (!(cin >> choice)) {
            cin.clear();
            cin.ignore(numeric_limits<streamsize>::max(), '\n');
            continue;
        }

        if (choice == 0) break;
        system("cls");
        if (choice == 1) OZLabs1();
        else if (choice == 2) OZLabs1_1();
        else if (choice == 3) OZLabs1_2();
        else {
            cout << "Invalid map selection." << endl;
        }
        if (choice >= 1 && choice <= 3) system("pause");
    }
}

